  const col2 = ["Facebook", "Twitter", "Instagram"];
  const listItems = col1.map((l_item) =>
    <li><a href="">{l_item}</a></li>
  );

  const listItems2 = col2.map((l_item2) =>
    <li><a href="">{l_item2}</a></li>
  );
